import FollowedShop from '../components/pages/user/UserFollowedShop.vue';

export default [
    {
      path: '/user_followed_shop',
      name: 'FollowedShop',
      component: FollowedShop,
    },

    {
      path: '/shipping_info',
      name: 'ShippingInfo',
      component: ShippingInfo,
    },

    
]
